import React from 'react';
import { LineChart, Line, XAxis, YAxis, Tooltip, CartesianGrid, Area, AreaChart } from 'recharts';

function PredictionChart({ data }) {
  return (
    <AreaChart width={600} height={300} data={data}>
      <XAxis dataKey="date" />
      <YAxis />
      <Tooltip />
      <CartesianGrid stroke="#ccc" />
      <Area type="monotone" dataKey="yhat" stroke="#8884d8" fill="#8884d8" name="Predicted Price" />
      <Area type="monotone" dataKey="yhat_upper" stroke="#82ca9d" fillOpacity={0.2} fill="#82ca9d" name="Upper Bound" />
      <Area type="monotone" dataKey="yhat_lower" stroke="#ffc658" fillOpacity={0.2} fill="#ffc658" name="Lower Bound" />
    </AreaChart>
  );
}

export default PredictionChart;
